import React, { useState, useEffect } from "react";
import axios from 'axios'
import { useHistory } from 'react-router';
const Cars = () => {

    const [cars, seteCars] = useState([])
    const history = useHistory()

    const getCars = async () => {
        const response = await axios.get('http://127.0.0.1:8000/list/')
        seteCars(response.data)
        console.log(response.data)


    }
    useEffect(() => {
        getCars();

    })





    return (

        <div>

            <h1 className='title'> Cars List</h1>


                {
                    cars.map((car, index) => (

                            <div key={index} >

<div class="card" style="width: 18rem;">
  <img class="card-img-top" src="..." alt="Card image cap"/>
  <div class="card-body">
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
  </div>
</div>

                                <div class="container d-flex justify-content-center mt-50 mb-50">
                                    <div class="row">
                                        <div class="col-md-4 mt-2">
                                            <div class="card">
                                                <div class="card-body">
                                                    <div class="card-img-actions"> <img src={car.image} class="card-img img-fluid"  alt="" /> </div>
                                                </div>
                                                <div class="card-body bg-light text-center">
                                                    <div class="mb-2">
                                                        <h6 class="font-weight-semibold mb-2"> <h2>{car.model}</h2>
                                                            <h4> {car.serie}</h4>
                                                            <p className="card-text ">Year: {car.year}</p>
                                                            <p className="card-text">Date creation Pub: {car.date}</p>
                                                            <p className="card-text">Dscription: {car.description}</p></h6>
                                                    </div>
                                                    <h3 class="mb-0 font-weight-semibold">Price: {car.price}</h3>

                                                   <button type="button" class="btn bg-cart"><i class="fa fa-cart-plus mr-2"></i> View detail</button>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>

                            </div>


                    ))
                }
            </div>



    );

};
export default Cars;
